import React from 'react';s
import { Card, CardContent, Typography, Divider } from "@mui/material";
import TraitCard from "../components/TraitCard";
import RiskChart from "../components/RiskChart";

export default function ReportPage() {
  const r = JSON.parse(localStorage.getItem("report") || "{}");

  if (!r || !r.status) {
    return (
      <Card sx={{ maxWidth: 600, margin: "40px auto", p: 3 }}>
        <CardContent>
          <Typography variant="h5">No report found</Typography>
          <Typography>Please upload a DNA file.</Typography>
        </CardContent>
      </Card>
    );
  }

  return (
    <div style={{ maxWidth: 600, margin: "40px auto" }}>
      <Card sx={{ p: 3 }}>
        <CardContent>
          <Typography variant="h4" sx={{ mb: 2 }}>
            Genetic Report
          </Typography>

          {/* APOE */}
          <Typography variant="h6">APOE</Typography>
          <Typography sx={{ mb: 2 }}>{r.apoe}</Typography>

          <Divider sx={{ my: 2 }} />

          {/* PRS Chart */}
          <Typography variant="h6">Polygenic Risk Score</Typography>
          <RiskChart score={r.prs} />

          <Divider sx={{ my: 2 }} />

          {/* Traits */}
          <Typography variant="h6" sx={{ mb: 1 }}>
            Predicted Traits
          </Typography>

          {r.traits &&
            Object.entries(r.traits).map(([trait, info]) => (
              <TraitCard
                key={trait}
                title={trait.replace("_", " ").toUpperCase()}
                result={info}
              />
            ))}
        </CardContent>
      </Card>
    </div>
  );
}
